import React from 'react';
import { NavLink } from 'react-router-dom';
import Programs from '../Programs/Programs';

const Home = () => {
    return (
        <div>
          <h1>Homepage</h1>  
          <NavLink to="/programs"> 
          <Programs></Programs>
          </NavLink>
        </div>
    );
};

export default Home;
